  \"2016-11-25T21:06:38.834775\",\n\t\"name\": \"2013-teaching-and-learning-international-survey\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Teaching and Learning International
  Survey, 2013 (TALIS:13), is a study that is part of the Teaching and Learning International
  Survey (TALIS) program. TALIS:13 (http://nces.ed.gov/surveys/talis/) is a cross-sectional
  survey that is designed to collect information about the teaching workforce, teaching
  as a profession, and the learning environments of schools. The study will be conducted
  through questionnaires for teachers and school administrators. Teachers and school
  administrators in lower secondary schools (Grades 7, 8, and 9) were sampled. Key
  statistics produced from TALIS:13 include information on teacher and principal background
  and characteristics, teacher and principal professional development, school leadership
  and management, teacher appraisal and feedback, teachersufffd instructional beliefs
  and pedagogical practices, school climate and ethos, student characteristics as
  perceived by the teacher, and teacher efficacy and job satisfaction.\",\n\t\"license_title\":
